import './App.css';
import axios from 'axios';

function App() {
  return (
    <div className="App">
        <div className="container">
            <h2>Products</h2>
            <table>
                <thead>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Description</th>
                    <th>Price</th>
                </thead>
                <tbody>
                    <tr>
                        <td></td>
                    </tr>
                </tbody>
            </table>
        </div>
    </div>
  );
}

export default App;
